import React, { Component } from 'react';

class History extends Component {
  render() {
    return (
      <div>
        <div className="ms-Grid-row" style={{margin:'0px',marginBottom:'10px'}}>
          <div className="ms-Grid-col ms-sm12">

            history bhaji
          </div>
        </div>
      </div>
    );
  }
}

export default History;
